The Cartesian product of two sets A and B, denoted as A x B, is the set of all ordered pairs (a, b) where a ∈ A and b ∈ B. 

Let A = {1, 2, 3} and B = {4, 5}. We can compute the Cartesian product A x B as follows:

A x B = {(1, 4), (1, 5), (2, 4), (2, 5), (3, 4), (3, 5)}

Now, let's compute the Cartesian product of B and A, which is B x A:

B x A = {(4, 1), (4, 2), (4, 3), (5, 1), (5, 2), (5, 3)}

Comparing the two Cartesian products, we can see that A x B is not equal to B x A:

A x B = {(1, 4), (1, 5), (2, 4), (2, 5), (3, 4), (3, 5)}
B x A = {(4, 1), (4, 2), (4, 3), (5, 1), (5, 2), (5, 3)}

The elements in A x B are not the same as the elements in B x A. This shows that the Cartesian product of two sets is not commutative.
